@Component({
  selector: 'app-consultar-libros',
  templateUrl: './consultar-libros.component.html',
  styleUrls: ['./consultar-libros.component.css']
})
export class ConsultarLibrosComponent {

}
<div class="card col-md-10 mt-6 mx-auto">
    <div class="card-header bt-info text-center">
      <h5 style= "font-size: 35px;color: #6a5acd">Consultas</h5>

    <button type="button" class="btn btn-outline-dark">Visitar Perfil</button>
    <form class="d-flex">
        <input class="form-control me-2" type="text" placeholder="Consultas Libro">
        <button class="btn btn-secondary" type="button">Buscar</button>
      </form>
      <br>
      <style>
        table {
          border:1px solid slateblue;
          width: 100%;
        }
        th, td {
          border:1px solid slateblue;
        }

        </style>
      <table>
        <tr>
          <th>Título</th>
          <th>Autor</th>
          <th>Año</th>
          <th>Edición</th>
        </tr>
        <tr>
          <td>La Metamorfosis</td>
          <td>Franz Kafka</td>
          <td>1916</td>
          <td>Casa del lobro latam</td>
        </tr>

      </table>

